The application, Old Testament Student, depends on a number of files for:
   a) both the Masoretic Text (Hebrew and Aramaic) and the Septuagint (Greek);
   b) the lexicon data for both texts;
   c) the structure of the virtual keyboard;
   d) help;
   e) other, associated elements.
If you have created any notes, they are also stored in the same location.
By default, all these files are stored in your User profile.  This is because available Setup tools make it difficult to privide the end user with the option to choose where to place files other than the main application executable.  You may want to move these for a number of reasons:
   a) Accessibility - specifically, so that you know where your notes are and that they are easy to get to;
   b) Accessibility to others;
   c) Space - move them off the main Windows drive.
